import AdminHome from "../AdminHome"
import {Switch,Route} from 'react-router-dom'
const AdminNestedRoute =()=>{
    return(
        <Switch>
             <Route path={'/auth'} component={AdminHome} exact/>
        </Switch>
    )
}

export default AdminNestedRoute
